def compare(lr, mini_batch_size, momentum, num_hidden, num_layers, num_epochs, a):
    loss = np.square((lr - a[0]) / lr)
    loss += np.square((mini_batch_size - a[1]) / mini_batch_size)
    loss += np.square((momentum - a[2]) / (momentum+0.001))
    loss += np.square((num_hidden - a[3]) / num_hidden)
    loss += np.square((num_layers - a[4]) / num_layers)
    loss += np.square((num_epochs - a[5]) / num_epochs)
    return loss


def get_results(lr, mini_batch_size, momentum, num_hidden, num_layers, num_epochs):
    e = None
    r = []
    for i in res:
        for v in i:
            if e is None:
                e = compare(lr, mini_batch_size, momentum, num_hidden, num_layers, num_epochs, list(v.values()))
                r = [v]
            else:
                t=compare(lr, mini_batch_size, momentum, num_hidden, num_layers, num_epochs, list(v.values()))
                if t < e:
                    e = t
                    r = [v]
                elif t==e:
                    r.append(v)
    tr=[]
    te=[]
    ti=[]
    for i in r:
        tr.append(i['train_error'])
        te.append(i['test_error'])
        ti.append(i['exec_time'])
    return np.mean(tr),np.mean(te),np.mean(ti)

